import React from "react";
import Navbar from "../components/Navbar";

class Prueba extends React.Component {
  render() {
    return (
      <>
        <Navbar />
        <p>soy una prueba</p>
        <Link to="/">Ir a la home</Link>
      </>
    );
  }
}

export default Prueba;
